{"function":"() => {
    const data = [];
    const tableRows = document.querySelectorAll('table.tablesorter tbody tr');
    tableRows.forEach((row, index) => {
        if (index < 30) { // Get top 30
            const rank = index + 1;
            const universityName = row.querySelector('a.uni_name').textContent.trim();
            const city = row.querySelector('td:nth-child(3)').textContent.trim(); // Assuming city is in the 3rd column
            data.push({
                university: universityName,
                city: city,
                cs_ranking_rank: rank
            });
        }
    });
    return data;
}"}

